  return (
    <div
      className='modal '
      tabIndex='-1'
      role='dialog'
      style={{
        display: showAccountDetails ? 'block' : 'none',
        color: 'black',
      }}
    >
      <div className='modal-dialog' role='document'>
        <div
          style={{
            background: 'black',
            borderRadius: '10px',
          }}
          className='modal-content  neonText'
        >
          <div
            type='button'
            className='close guest-modal'
            onClick={() => setShowAccountDetails(false)}
