            <div
              style={{
                color: 'white',
                display: 'flex',
                flexDirection: 'column',
              }}
            >
              <div
                style={{
                  textAlign: 'center',
                  marginBottom: '10px',
                  fontWeight: 700,
                  fontSize: 24,
                }}
              >
                Cash Gift
              </div>

              <span
                style={{
                  fontSize: 20,
                  color: 'white',
                }}
