                    marginBottom: '10px',
                  }}
                >
                  Bank:
                </span>{' '}
                Wema Bank
              </span>
              <span
                style={{
                  fontSize: 20,
                  color: 'white',
                }}
              >
                <span
                  style={{
                    color: '#f0f0f0',
                    fontSize: '16px',
                    marginRight: '10px',
                    marginBottom: '10px',
                  }}
                >
                  Name:
                </span>{' '}
                Adewale AkinlagunÂ 
              </span>
              <span
                style={{
                  fontSize: 20,
                  color: 'white',
                }}
              >
                <span
                  style={{
                    color: '#f0f0f0',
                    fontSize: '16px',
                    marginRight: '10px',
                    marginBottom: '10px',
                  }}
                >
                  Account Number:
                </span>{' '}
                0233584142
              </span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AccountDetails;
